Listing.where(title: "2005 Buick Rendezvous", description: "Take this '05 Rendezvous for a test drive and just try not falling in love with it!   There's plenty of room for 5 people to travel comfortably in this fabulous Rendezvous CX and you'll even have plenty of room in the back to haul home all of the great deals you found while you were out and about!  The V6 engine under the hood provides ample power and gives you an SUV that handles like a dream! And with the EPA rating of 19/26 mpg city/highway, you won't have to spend as much time at the gas station!   Get ready to enjoy all of the comforts this Rendezvous has in store for you. For instance, the center console has plenty of room to hold your purse and there's even extra storage space underneath! Genius! The cloth upholstery is extremely comfortable, the power amenities make life a little easier, and the modern design (inside and out) help you repeal the soccer mom image that mini-van's attract like magnets.  One trip around the block in this Rendezvous is all it's going to take to sell this one! You'd better get in here quickly, or it's going to be gone! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years. Print this Page and Call us Now!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2005, miles: 127876, transmission: "Automatic", color: "Frost White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5999, newused: "U", vin: "3G5DA03E35S530895", stocknumber: "BCSJ68", model: "Rendezvous", trim: nil, enginedescription: "3.4L 6 Cylinders", interiorcolor: "Gray", options: "Air Conditioning : A/C,Audio : Am/Fm Stereo,Audio : Cd Player,Console, Floor, Includes Cupholders, Laptop And Cell Phone Storage Cap