Listing.where(title: "2005 Chevrolet Impala", description: "Our Clean Carfax 2005 Impala LS brings a lot to the family sedan table. The fact that it can seat five means you can grab your friends and roll. The V6 power plant provides plenty of power along with respectable fuel mileage. The 3.8-liter V6 engine getting through traffic is a cinch. It employs a responsive four-speed automatic transmission that sends the power through the front wheels.   There's loads of interior space and a good array of equipment to make the ride comfortable and enjoyable. Our LS trim model adds dual-zone climate control and supple leather in addition to already standard features. This beautiful Impala continues the tradition of large, affordable Chevrolet family sedans with attributes like solid performance and fuel efficiency, high crash test scores, a roomy cabin and a smooth, quiet ride. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years. Did you see the sunroof?", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2005, miles: 108159, transmission: "Automatic", color: "Silverstone Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5999, newused: "U", vin: "2G1WH55K959267041", stocknumber: "CNSJ078", model: "Impala", trim: "LS", enginedescription: "3.8L 6 Cylinders", interiorcolor: "Medium Gray", options: "Air Bags, Dual-Stage, Frontal, Driver And Right Front Passenger (Always Use Safety Belts And Proper Child Restraints, Even With Air Bags. Children Are Safer When Properly Secured In A Rear Seat. See The Owners Manual For More Safety Information.),Air Conditioning : Multi-Zone A/C,Air Conditioning, Dual-Zone, Manual, Includes Individual Climate Settings For Driver And Rig