Listing.where(title: "1999 Chevrolet Suburban", description: "This 1999 Clean Carfax Chevy Suburban is ready for a new life! Under the hood you get a 5.7L V8 engine producing 255hp with an automatic transmission that will reward you tons of power. This beast is ready to take on the countryside, snowy roads, mud, and any other issue that may come its way! Hunters will appreciate its roominess and truck-like abilities to load up equipment and the dogs. Parents can send their child into a school parking lot with nary a worry.  Check out the features list and pictures. You will find a nice sound system, power outlet, and, best of all, a nice reliable machine just waiting for you to take it home!  Whatever you need to haul, this Suburban can handle it! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 1999, miles: 167627, transmission: nil, color: "Summit White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 3999, newused: "U", vin: "3GNEC16R8XG246848", stocknumber: "KCSJ57", model: "Suburban", trim: nil, enginedescription: "5.7L 8 Cylinders", interiorcolor: "Gray", options: "3-Passenger Front Bench Seat W/Outboard Head Restraints,Assist Handles For Outboard Front/2Nd Seat Passengers,Brake/Transmission Shift Interlock,Convenience : Engine Immobilizer,Convenience : Intermittent Wipers,Convenience : Power Outlet,Day/Night Rearview Mirror,Driver & Front Passenger Next Generation Air Bags,Locks : Power Door Locks,Passlock Theft Deterrent System,Rear Door Lock Switch,Rear Seat Heat Ducts,Safety Features : Daytime Running Lights,Seats : Fixed Bench Seat,Steering : Power Steering", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: nil, make: "Chevrolet", approved: tr