Listing.where(title: "2001 Chrysler PT Cruiser", description: "Our 2001 PT Cruiser Wagon with Clean Carfax combines the retro look of late-'30s American iron with modern performance, efficiency and features. It blends the retro look of the early American sedan with new-age styling cues such as dual-beam flush headlights and teardrop-shaped taillight lenses. This baby has leather seats, power sunroof, AM/FM stereo, CD player, cassette, and full floor carpeting!  This 4-door model's tall body boasts lots of room for people and cargo. In fact, its interior volume and versatility compare well to a small SUV. Fold the seats down and you can carry an eight-foot ladder. Pull the rear seats out and you can haul a load of building materials or a big-screen TV. Yet our PT Cruiser is small and easy to park. It's also easy on gas.  Our Cruiser is a great choice for people of all ages and lifestyles with its whimsical, retro design and functional attitude. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! 10 DAY CASH BLOWOUT SALE!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2001, miles: 98030, transmission: "Automatic", color: "Stone White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 3999, newused: "U", vin: "3C8FY4BB61T593763", stocknumber: "ACSJ118", model: "PT Cruiser", trim: nil, enginedescription: "2.4L 4 Cylinders", interiorcolor: "Gray", options: "Air Conditioning : A/C,Air Conditioning W/Front & Rear Outlets,Audio : Am/Fm Stereo,Child Seat Anchor System,Convenience : Intermittent Wipers,Convenience : Power Outlet,Driver/Front Passenger Next Generation Airbags,Instrument Cluster W/Tachometer,Pwr Windows W/Driver & Front Passenger 1-Touch Down,Rear Door Child Protection Locks,Rear Window Defroster,Seats : Bucket Seats,Steering : Power Steering,Window : Power Windows