Listing.where(title: "1995 Dodge Ram 1500", description: "Our 1995 Dodge Ram 1500 4X2 is a machine built for work and play. Powered by an impressive 5.2 Liter V8 while connected to a durable Automatic transmission. Feel the power in this Rear Wheel Drive machine workhorse and its' impressive horsepower. The tow package will let you drag all your toys to the lake and beyond.   This Ram has some fantastic options available that you will appreciate, such as AM/FM stereo with CD player, beautiful cloth interior, bed liner and more! Load up the gang and hit the road!  Drivers of this Dodge Ram 1500 are pretty happy with the truck and the the overall performance of the Ram, which seems to be a true workhorse. So how do you get this? Print this page out and call us NOW for your personalized test drive towards ownership.  10 DAY CASH BLOWOUT SALE!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 1995, miles: 151143, transmission: "Automatic", color: "Green", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 3999, newused: "U", vin: "1B7HC16Z3SS331135", stocknumber: "HCSJ37", model: "Ram 1500", trim: nil, enginedescription: "5.9L 8 Cylinders", interiorcolor: "Tan", options: "11.4\" Day/Night Rearview Mirror,Air Bag - Frontal : Driver Air Bag,Black 2-Spoke Steering Wheel,Color-Keyed Full Length Door Trim Panels W/Armrests,Color-Keyed Instrument Panel W/Ash Receiver & Non-Locking Glove Box,Convenience : Intermittent Wipers,Dash/Plenum Insulation Liners,Deluxe 2-Speed Intermittent Windshield Wipers,Dual Color-Keyed Vinyl Sun Visors W/Center Supports,Dual-Opening Retractable Cup Holder,Fasten Seat Belts/Key-In-Ignition/Headlamps-On Warning Chimes,Hood Release In Cab,Steering : Power Steering,Tinted Glass Windows,Voltmeter, Trip Odometer, Oil Pressure/Engine Temp Gauges", imagefront: nil, imageback: nil, imageleft: nil, imager