Listing.where(title: "2005 Dodge Ram 1500", description: "Bottom line, the Ram is arguably the best-looking truck on the market. Our One Owner Clean Carfax 2005 RWD Dodge Ram is bold, handsome, and sophisticated. It's powered by a 4.7 Liter V8 and coupled with a 4 Speed Automatic supplies you with 235hp. This one has real get up and go!  Our Dodge Ram is among the roomiest of the full-size pickups and the cab is a pleasant place to be. With AM/FM stereo, front bench seat, bed cover and more. You will love this truck!   This 2005 Ram offers big power and big capabilities. It's responsive and comfortable as an every day driver and it's ready to do some serious work when called upon. Ram's distinctive styling makes it stand out in a rapidly improving field of full-sized trucks. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! 10 DAY CASH BLOWOUT SALE!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2005, miles: 119618, transmission: "Automatic", color: "Flame Red", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 9999, newused: "U", vin: "1D7HA18N35J652575", stocknumber: "FCSN37", model: "Ram 1500", trim: "ST", enginedescription: "4.7L 8 Cylinders", interiorcolor: "Dark Slate Gray", options: "12V Pwr Outlet,Air Bag - Frontal : Driver Air Bag,Air Bag - Frontal : Passenger Air Bag,Air Bag - Frontal : Passenger Air Bag On/Off Switch,Air Conditioning : A/C,Audio : Am/Fm Stereo,Convenience : Intermittent Wipers,Convenience : Power Outlet,Convenience : Variable Speed Intermittent Wipers,Driver/Front Passenger \"Next Generation\" Airbags W/Passenger On/Off Switch,Front Shoulder Belt Height Adjusters,Rear Underseat Storage Compartment,Seats : Rear Bench Seat,Steering : Power Steering,Tilt Steering Column", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontin