Listing.where(title: "2010 Ford Escape", description: "Introducing our One Owner Clean Carfax, 2010 Ford Escape XLT! Powered by a proven 2.5 Liter 4 Cylinder that offers 171hp while connected to a smooth shifting Automatic transmission. Our Front Wheel Drive Escape is a family-friendly compact SUV offering safety, comfort, and performance while providing near 26mpg on the open road.  You'll appreciate the commanding stance of our Ford Escape XLT with its great looking wheels and chrome highlights. Inside, features such as keyless entry, full power accessories, steering wheel audio controls, an auto-dimming rearview mirror, and a stellar sound system complete with AM/FM/CD/Aux and available satellite radio make every ride feel first class.  Ford's top-notch safety equipment is on board for your peace of mind as well. A tire pressure monitoring system, AdvanceTrac with roll stability control, and MyKey system for the young teenager make this an outstanding car. Get behind the wheel, and we know you'll be impressed with this confident ride! Thanks for taking a look at our 2010 Ford Escape. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2010, miles: 100592, transmission: "Automatic", color: "Oxford White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7999, newused: "U", vin: "1FMCU0DG1AKA32482", stocknumber: "KCSR77", model: "Escape", trim: "XLT", enginedescription: "3L 6 Cylinders", interiorcolor: "Tan", options: "4-Wheel Anti-Lock Brakes,Audio : Am/Fm Stereo,Audio : Cd Player,Audio : Satellite Radio,Dual Stage Driver & Front Passenger Airbags -Inc: Front Passenger Occupancy Sensor,Locks : Keyless Entry,Pwr Points -Inc: (1) 1St Row, (1) 2Nd Row,Pwr Windows W/1-Touch Driver Down,Safety Features : Child Safety Locks,Saf