Listing.where(title: "2000 Ford Explorer", description: "This Clean Carfax Explorer is easily the best-selling sport-utility in America. Ford has been getting it right for years and you can be confident this one offers ultimate value, quality, and style for your investment. Under the hood is a proven V6, our 4.0 Liter assures a certain level of command of the road with an ability to accelerate easily for merging or passing. It's the great choice for doing any towing, with reserve power for climbing hills and bucking headwinds. The V6 offers quiet cruising on the highway and in town.  The inside of the Ford Explorer looks like America's living room, which is appropriate, considering that so many Americans spend so much time there. The front passengers get a pair of comfy captain's chairs, covered in a premium cloth for the XLT. The bench seat offers three-passenger capacity; the rear seat is split so that either half can be folded down for versatility when moving cargo and people at the same time. Big doors make access easy.   Consider this SUV the modern American station wagon. If Norman Rockwell were alive today, he'd be painting families in Ford Explorers. Beyond that, the Explorer offers a utilitarian, outdoorsy image that no minivan can match. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2000, miles: 121165, transmission: "Automatic", color: "Deep Wedgewood Blue Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 4499, newused: "U", vin: "1FMZU73E1YZC54525", stocknumber: "KAYJ17", model: "Explorer", trim: "XLT", enginedescription: "4L 6 Cylinders", interiorcolor: "Gray", options: "12-Volt Pwr Point,5-Passenger Seating,Air Conditioning : A/C,Air Conditioning : Rear A/C,Audio : Am/Fm Stereo,Audio : Cd Playe