Listing.where(title: "2003 Honda Accord Cpe", description: "Own this top-of-the-line model of the fantastically popular Honda Accord Coupe and enjoy classic styling, great power and great economy as well. This is one of the most user-friendly automobiles you can imagine! Honda is famous for powertrain development and this Accord EX is no exception. It's engine makes accelerating up an on-ramp an experience, rather than an uncertain chore.   By any account, this EX is an outstanding car. The fit and finish are impeccable. Comfort and features are tops and this car will turn a short errand into a pleasant drive. This is a great opportunity to own a real class-leading car. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2003, miles: 124385, transmission: "Automatic", color: "Nighthawk Black Pearl", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 4999, newused: "U", vin: "1HGCM72603A032037", stocknumber: "GAYJ217", model: "Accord Cpe", trim: "EX", enginedescription: "2.4L 4 Cylinders", interiorcolor: "Gray", options: "Am/Fm Stereo W/Cd Changer-Inc: (6) Speakers (120W),Audio : Am/Fm Stereo,Audio : Cd Changer,Audio : Cd Player,Child Safety Seat Anchors (Latch),Convenience : Intermittent Wipers,Convenience : Remote Trunk Release,Convenience : Security System,Convenience : Steering Wheel Audio Controls,Convenience : Variable Speed Intermittent Wipers,Driver & Front Passenger Airbags (Srs),Locks : Keyless Entry,Locks : Power Door Locks,Window : Power Windows,Window : Rear Defrost", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: "Coupe", make: "Honda", approved: true, expiration_date: "2218-01-03 01:44:43", external_url: true, external_image: "http://images.deal