Listing.where(title: "2005 Honda Civic Sdn", description: "If you're looking at our 2005 Civic, most likely you're in the market for something efficient, practical, affordable, polished, and fun to drive with a reputation for reliability. This Clean Carfax, white on tan interior, LX sedan certainly fits the bill! This LX gets it's power from a 1.7-liter engine 4 cylinder engine. This nice engine has lots of energy and will get you an EPA estimated 29/38 mpg city/highway! Go ahead and pass up that gas station!   Our Civic LX lives up to Honda's reputation for space-efficient design with plenty of space for passengers without feeling like you're driving a boat!   Our Civic is like the best utility player on the ball team - other small cars might beat it in a particular area or category, but few match its overall balance of strengths! You're going to love this Civic, so hurry in before it's gone! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2005, miles: 178513, transmission: "Automatic", color: "Taffeta White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 4599, newused: "U", vin: "2HGES16545H539329", stocknumber: "AAVQ18", model: "Civic Sdn", trim: "LX", enginedescription: "1.7L 4 Cylinders", interiorcolor: "Tan", options: "Air Bag - Frontal : Driver Air Bag,Air Bag - Frontal : Passenger Air Bag,Audio : Am/Fm Stereo,Audio : Cd Player,Auxiliary Pwr Socket,Child Safety Seat Anchors (Latch),Childproof Rear Door Locks,Convenience : Power Outlet,Convenience : Remote Trunk Release,Convenience : Variable Speed Intermittent Wipers,Driver & Front Passenger Airbags (Srs),Front/Rear 3-Point Seat Belts,Pwr Windows W/Auto-Down Driver Window & Illuminated Driver Switch,Window : Power Windows,Window : Rear Defrost", imagefront: ni