Listing.where(title: "2009 Honda Fit", description: "Our One Owner, Clean CarFax 2009 Honda Fit Sport Hatchback in Orange over dark interior is dressed up and one of the most stylish machines in its class, with a nicely raked front end. It's a fun and fuel-efficient five-door urban hopper. Under the hood is a peppy 1.5 Liter 4 Cylinder that offers plenty of zip and pushed the 40mpg envelope with ease. Tethered to a Automatic, our Front Drive machine handles the road with ease and the way this vehicle configures is amazing for anyone needing space.   Rear passengers get extra head and legroom and the Fit offers a best-in-class cargo space with the rear seats up. Our Fit also features a very versatile rear 60/40 split seat that folds down flat, as does the front passenger seat, for a maximum of 57 cubic feet of cargo space. The interior is functional and well laid-out, with increased leg and headroom for rear-seat passengers.   While fuel economy is pretty much at the top of the checklist when shopping these days, no one wants to compromise safety for it. The Fit features dual-stage front, side and side curtain airbags, front disc/rear drum anti-lock brakes and Electronic Brake Distribution. Honda has improved the grade of steel used to build the Fit as well as incorporated its Advanced Compatibility Engineering technology so don't delay. Print this out and come see us today for a personalized test drive towards ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years. 10 DAY CASH BLOWOUT SALE!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2009, miles: 78297, transmission: "Automatic", color: "Orange Revolution Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7999, newused: "U", vin: "JHMGE88439S046864", stocknumber: "BCSJ78", model: "