Listing.where(title: "1999 Lexus ES 300 Luxury Sport Sdn", description: "This is the entry-level ticket to the Lexus experience. And All of the Lexus Experience can be found here. The Lexus ES 300 is arguably the most refined automobile in what auto marketers call the near luxury class. It's also quite nice to look at. Athletic sporting reflexes make the ES 300 good fun to drive, and it offered more power for 1999.  Over the years the ES 300 has performed with such appliance-like efficiency that auto critics have made vague claims about its lack of soul. This could really be another way of saying that the critics can't specifically find much wrong with the car.  Like most Lexus products, its overriding characteristic is smoothness. Smooth, smooth, smooth, very quiet and smooth. That's the overriding impression one takes from the ES 300. Noise and vibration control in the cabin matches cars that cost thousands more.  The ES 300 is actually a highly polished, more luxuriously trimmed version of the Toyota Camry, and that's no dig. It's officially classified as a compact, but the ES 300 provides plenty of space for large adults in the front seats. The back seat comfortably accommodates three children or two adults. The trunk is good for a couple of golf bags, and larger than many in the class.  You could spend your hard-earned money on something else, but dollar for dollar, you will be hard pressed to find one with the balance of comfort, luxury, performance, refinement and quality finish as this ES 300. Print this page and Call Us Now! Hurry in today to test drive this sedan!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 1999, miles: 133976, transmission: "Automatic", color: "Silver", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 2999, newused: "U", vin: "JT8BF28GXX0149755", stocknumber: "HCSJ47", model: "ES