Listing.where(title: "2007 Nissan Xterra", description: "Our '07 Xterra is the genuine article: a real, Safari-grade adventure vehicle that can still handle everyday life on pavement with refinement and ease. Like its big brother, the Nissan Pathfinder, the Xterra is substantial, sophisticated, and refined. From its uncles, Titan and Armada, it has inherited a well-engineered, fully boxed ladder frame. Sophisticated electronics help maintain traction and stability over all kinds of uncertain terrain. Power comes via a 4.0-liter version of Nissan's acclaimed VQ V6 used in the 350Z, its fast living Nissan sister.  This Xterra is roomy inside, roomier than other SUVs in its class. It would work great for carrying four large adults and their gear into the backcountry. Second-row seating is stadium-style, meaning that the rear passengers can see over the front-seat occupants. This is an S trim model, so some extras are on board (in addition to the long list of standard features) including running boards and roof rack cross bars.   There is nothing else quite like an Xterra. It's in its element when used as a truck, a dirt-road prowler, or an adventure vehicle. It can handle wet or dirty cargo and clean up like a champ. Our '07 is considerable improved over pre-2005 models with more power, more room, and more carefully thought-out utility features. It's built on a rugged chassis. Yet it's more refined in every way, making it a much more practical everyday vehicle that you will enjoy 24/7/365. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! 10 DAY CASH BLOWOUT SALE!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2007, miles: 109597, transmission: "Automatic", color: "Maroon", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7360, newused: "U", vin: "5N1AN08UX7C508526", stocknumber: "ACSJ168", model: "Xterra", trim: "S", enginedescription: "4L 6 Cylinders", interiorcolor: "Gray", options: "(10) Tie-Down Points-Inc: (6) Cargo Area Utility Hooks, (4) Adjustable Cleats,(4) 12-Volt Dc Pwr Outlets (2 Live),Audio : Am/Fm Stereo,Audio : Cd Player,Convenience : Intermittent Wipers,Convenience : Luggage Rack,Convenience : Power Outlet,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Windows W/Driver Auto-Down,Rear Stadium Seating W/Raised Roofline,Rear Window Defroster,Vehicle Security System W/Immobilizer,Window : Privacy Glass,Window : Rear Defrost", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: nil, make: "Nissan", approved: true, expiration_date: "2218-01-03 01:44:43", external_url: true, external_image: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181046638_d4a4f7439987498180eb92eccc01dc18.jpg", external_imagefront: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181046927_e1ad4085464a4b96a6a4214890813ba2.jpg", external_imageback: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181047322_49d72ee517344e33a2d7f2907700f23f.jpg", external_imageleft: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181048112_8fc4a188d89741b48d94afcb32ba9ae1.jpg", external_imageright: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181048274_5eb177aa84b84ebb98ce82f45f214ada.jpg", external_frontinterior: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181048530_1957f113fe254d619a8d832521d6716a.jpg", external_rearinterior: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176064/20180205181048970_4679e42c67124461893933c1c89e6fc1.jpg").first_or_create
Listing.where(title: "2002 Nissan Xterra", description: "Our 2002 Nissan Xterra XE is a compact SUV with an emphasis on both Sport and Utility unlike the SMVs (soccer mom vehicles) or GHVs (grocery hauling vehicles) that most of the current crop of SUVs have morphed into. This baby can do those too - but it can handle the rugged off-road side as well.   This sporty little beast of burden is just as comfortable on the highway as it is on back country roads! Plus, it also has the rugged reliability that keeps it rolling no-matter the miles it's eaten!   Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2002, miles: 136224, transmission: "Automatic", color: "Silver Ice Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5500, newused: "U", vin: "5N1ED28T22C553945", stocknumber: "LCSJ127", model: "Xterra", trim: "XE", enginedescription: "3.3L 6 Cylinders", interiorcolor: "Gray", options: "(4) Cargo Floor Tie-Down Hooks,3-Point Front Seat Belts W/Height Adjusters, Pretensioners/Load Limiters,Air Bag - Frontal : Driver Air Bag,Air Bag - Frontal : Passenger Air Bag,Audio : Am/Fm Stereo,Audio : Cd Player,Child Safety Rear Door Locks,Convenience : Power Outlet,Driver & Front Passenger Dual Stage Airbags,Latch Child Safety Seat System-Inc: Lower Anchors, Tether,Rear Window Defroster,Safety Features : Child Safety Locks,Seats : Bucket Seats,Seats : Rear Bench Seat,Window : Privacy Glass", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: nil, make: "Nissan", approved: true, expiration_date: "2218-01-03 01:44:43", external_url: true, external_image: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176089/20180205181640265_1b377ae1d8fa4e7287537959